import "../Table.css";
import { FaTimes } from "react-icons/fa";
import { useState } from "react";

const SellHistory = ({ actualUser, deals, checkPosted, setTheUser }) => {
  const [hidden, setHidden] = useState([]);

  const handleCheckPosted = (id, posted) => {
    checkPosted(id, posted);
    setHidden(...hidden, String(id));
  };

  return (
    <div
      style={{
        position: "absolute",
        left: "25%",
        top: "50%",
        transform: "translate(-50%, -50%)",
        background: "black",
      }}
      className="card col-md-6 offset-md-3 offset-md-3"
    >
      <table className="table table-dark">
        <thead>
          <tr>
            <th scope="img">Photo</th>
            <th scope="col">C.C</th>
            <th scope="col">Fuel</th>
            <th scope="col">HP</th>
            <th scope="col">Price</th>
            <th scope="col">Year</th>
          </tr>
        </thead>
        <tbody>
          {deals.map((deal) =>
            deal.posted === 1 &&
            actualUser === deal.actual_seller_id &&
            hidden.indexOf(String(deal.id)) === -1 ? (
              <tr key={deal.id}>
                <td>
                  <img
                    src={require(`./${deal.picture}`)}
                    alt=""
                    style={{ border: 3, height: 200, width: 300 }}
                  />
                </td>
                <td>{deal.cc}</td>
                <td>
                  {deal.fuel}{" "}
                  <h3>
                    <FaTimes
                      size={100}
                      style={{ paddingTop: 40, color: "red" }}
                      onClick={() =>
                        handleCheckPosted(deal.id, 3, deal.actual_seller_id)
                      }
                    />
                  </h3>
                </td>
                <td>{deal.hp}</td>
                <td>{deal.price}</td>
                <td>{deal.year}</td>
              </tr>
            ) : (
              <tr></tr>
            )
          )}
        </tbody>
      </table>
    </div>
  );
};

export default SellHistory;
